import React from 'react';
import { Typography, Container, Box, Paper, Grid, List, ListItem, ListItemText } from '@mui/material';

const Projects = () => {
  const projects = [
    {
      title: "Microservices Architecture Implementation",
      description: "A scalable microservices-based system for a financial institution",
      technologies: ["Java", "Spring Boot", "Kafka", "Redis", "Docker"],
      points: [
        "Designed and implemented a distributed system using microservices architecture",
        "Integrated Kafka for real-time data streaming and event processing",
        "Implemented Redis for caching and session management",
        "Containerized services using Docker and set up Kubernetes clusters",
        "Developed monitoring and logging solutions using ELK stack"
      ]
    },
    {
      title: "AI-Powered Recommendation System",
      description: "Machine learning-based recommendation engine for e-commerce",
      technologies: ["Python", "TensorFlow", "Spark", "AWS"],
      points: [
        "Built a collaborative filtering recommendation system",
        "Implemented machine learning models for personalized recommendations",
        "Processed large datasets using Apache Spark",
        "Deployed the system on AWS cloud infrastructure",
        "Developed a RESTful API for integration with front-end applications"
      ]
    }
  ];

  return (
    <Container maxWidth="md" sx={{ mt: 8, mb: 8 }}>
      <Paper sx={{ p: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom align="center">
          Projects
        </Typography>
        {projects.map((project, index) => (
          <Box key={index} sx={{ mb: 4 }}>
            <Typography variant="h5" gutterBottom>
              {project.title}
            </Typography>
            <Typography variant="subtitle1" color="text.secondary" gutterBottom>
              {project.description}
            </Typography>
            <Typography variant="body1" color="text.secondary" gutterBottom>
              Technologies: {project.technologies.join(', ')}
            </Typography>
            <List>
              {project.points.map((point, i) => (
                <ListItem key={i} disablePadding>
                  <ListItemText primary={point} />
                </ListItem>
              ))}
            </List>
          </Box>
        ))}
      </Paper>
    </Container>
  );
};

export default Projects;
